import React from 'react';
import './navBar.css';
import {
Nav,
NavLink,
NavMenu,
NavBtn,
NavBtnLink,
} from './NavBar';
import Hamburger from './Hamburger';

const Navbar = () => {
	const [hamburgerOpen, setBurgerOpen] = React.useState(false);
	const toggleHamburger = () =>{
		setBurgerOpen(!hamburgerOpen);
	}
	return (
		<>
		<Nav>
				<NavLink to='/' activeStyle>
					<h1>WhatsTheHaps?</h1>
				</NavLink>	
				<NavMenu className='navigation'>		
				<NavLink to='/about' activeStyle>
					About us
				</NavLink>		
				<NavLink to='/terms' activeStyle>
					Terms and conditions
				</NavLink>	
				</NavMenu>
				<NavBtn>
				<NavBtnLink to='/signin'>Sign In</NavBtnLink>
				</NavBtn>
			<div className='hamburger' onClick={toggleHamburger}>
			<Hamburger></Hamburger>
			</div>
		</Nav>
		</>
	);
};

export default Navbar;
